import './App.css';
import Button from 'react-bootstrap/Button'



function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>1 of 1</Col>
        </Row>
      </Container>
      <Button variant="primary">6030</Button>{' '}
      <Button variant="secondary">6020</Button>{' '}
      <Button variant="success">6032</Button>{' '}
      <Button variant="warning">6005</Button>{' '}
    </div>
  );
}

export default App;
